package com.max.app.hackerrank;

import java.io.IOException;
import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;

public final class SuffixTrieMain {

    public static void main(String[] args) throws IOException {

        // 1,279,378,464

        final String str =
                "";

        // str.length = 55_500
        // expected: 6_965_250
        // actual:   6_965_250

        System.out.printf("str.length: %d%n", str.length());

        System.out.printf("maxValue: %d%n", maxValue(str));

        System.out.printf("nodes count: %d%n", Node.totalNodesCount);

        System.out.printf("java version: %s%n", System.getProperty("java.version"));
    }

    static long maxValue(String t) {
        Trie trie = new Trie();
        long maxSoFar = t.length();

        for (String singleSuffix : allSuffixes(t)) {
            maxSoFar = Math.max(maxSoFar, trie.add(singleSuffix));
        }

        return maxSoFar;
    }

    private static final int LOWER_CASE_ASCII_FROM = 'a';
    private static final int LOWER_CASE_ASCII_TO = 'z';
    private static final int LOWER_CASE_ASCII_COUNT = LOWER_CASE_ASCII_TO - LOWER_CASE_ASCII_FROM + 1;

    private static List<String> allSuffixes(String str) {

        List<String> suffixes = new ArrayList<>(str.length());

        for (int i = 0; i < str.length(); ++i) {
            suffixes.add(str.substring(i));
        }

        return suffixes;
    }

    private static final class Trie {

        private final Node root = new Node();

        public long add(String str) {
            Node cur = root;
            long maxValue = str.length();

            for (int i = 0; i < str.length(); ++i) {

                int chIndex = (int) str.charAt(i) - LOWER_CASE_ASCII_FROM;

                if (cur.children[chIndex] == null) {
                    cur.children[chIndex] = new Node();
                }

                cur = cur.children[chIndex];
                cur.incCount();

                final int substringLength = i + 1;
                maxValue = Math.max(maxValue, (long) cur.cnt * substringLength);
            }

            return maxValue;
        }
    }

    private static final class Node {

        static int totalNodesCount = 0;

        int cnt;
        final Node[] children = new Node[LOWER_CASE_ASCII_COUNT];

        Node() {
            ++totalNodesCount;
        }

        void incCount() {
            ++cnt;
        }

        @Override
        public String toString() {
            return "count: " + cnt + ": children: " + Arrays.toString(children);
        }
    }
}
